import Foundation
import XMLCoder

func saving(name: String, myPreset: [String: [[String: String]]]) {
    guard let documentsPath = FileManager.default.urls(for: .documentDirectory, in: .userDomainMask).first else { return }
    let destinationURL = documentsPath.appendingPathComponent(name)
    do {
        // удаляем если есть уже файл с таким названием
        try? FileManager.default.removeItem(at: destinationURL)
        // сохраняем
        let data = try JSONEncoder().encode(myPreset)
        let str = String(data: data, encoding: .utf8)
        try str?.write(to: destinationURL, atomically: true, encoding: .utf8)
        print(destinationURL)
    } catch {
        print(error)
    }
}

